    input.checked ? setSorted(sorted => !sorted) : setSorted(sorted => !sorted)
  }

  const input = <input type="checkbox" onCLick={handleChange}/>

  return (
    <div className="search">
      <input type="text" className="searchTerm" onChange = {(e) => setSearch(e.target.value)} />
      {input}
    </div>
  );
}

